import { sha256 } from 'js-sha256';

/**
 * execute callback. Variable name intentionally short
 */
// tslint:disable-next-line:no-any
export const p = <T = any>(innerFunction: (...args: any) => T) => innerFunction();

export const generateEventNameHash = (eventName: string): string => {
    // Only generate hash client side
    // tslint:disable-next-line: no-typeof-undefined
    if (typeof window !== 'undefined') {
        return sha256(eventName);
    }
    return eventName;
};
